var util           = require("util");
var ResponseHeader = require("../response");

function AcceptRangesHeader(value) {
    ResponseHeader.call(this, value);
}

util.inherits(AcceptRangesHeader, ResponseHeader);

AcceptRangesHeader.prototype.getKey = function() {
    return "Accept-Ranges";
};

module.exports = AcceptRangesHeader;
